organizmów i soli."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "71E8D4C349EC3E8DAB01A6B6870C6DD0", "W Walii istnieje miejscowość o nazwie Llanfairpwllgwyngyllgogerychwyrndrobwllllantysiliogogogoch. Jest jedną z najdłuższych nazw geograficznych na świecie."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "49A55ABF43F5D28719FA48A95BE71B57", "Księżyc każdego roku oddala się od Ziemi o około 3,8 cm. Oznacza to, że za miliardy lat nie będzie już całkowitych zaćmień Słońca!"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "CC91BDDE4A2240550E1B6F8C4504AE8E", "Rekord najniższej temperatury na Ziemi to -128,6°F (-89,2°C) i został zmierzony na Antarktydzie w 1983 roku."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "0FF094A946B4FECF39E325B75576F5BD", "W 2016 roku w Rosji rzeka Daldykan zmieniła kolor na czerwony. Przyczyną było prawdopodobnie zanieczyszczenie przemysłowe z pobliskiej fabryki niklu."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "BBDFAF044AD26439CF3AEE9D16617715", "W 2013 roku u wybrzeży Izraela odkryto 2000 złotych monet sprzed ponad 1000 lat. To jedno z największych znalezisk archeologicznych w tym rejonie."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "2EF9B5E84BCA20451018FFAF42D03B23", "Serce płetwala błękitnego waży około 600 kg i ma wielkość małego samochodu!"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "0FB7792245119C76801EB29FB92025A1", "Na Saharze znajduje się formacja skalna zwana „Okiem Sahary” (Richat Structure). Jest tak duża, że można ją zobaczyć z kosmosu."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "CAEA06444F2EFBB3537ADC898B8328CA", "Szacuje się, że na Ziemi jest około 3 bilionów drzew, co oznacza, że jest ich więcej niż gwiazd w Drodze Mlecznej!"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "F63FDFD4486C396FE98F3A94403D322C", "W Kapadocji znajduje się Derinkuyu – starożytne miasto wykute w skale, które mogło pomieścić nawet 20 000 ludzi.")),Appearance=(ColorAndOpacity=(SpecifiedColor=(R=0.283149,G=0.238398,B=0.165132,A=1.000000),ColorUseRule=UseColor_Specified),F